import { Route } from 'react-router-dom'; //Route component provided by react-router-dom

import Welcome from './components/Welcome';
import Products from './components/Products';

function App() {
  return (
    <div>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/products">
        <Products />
      </Route>
    </div>
  );
}

export default App;

//our domain.com/welcome => Welcome Component
//our domain.com/products => Product Component
